export function DateItem(props){
    return (
        <button className="dateItem" active={this.props.item.active} disable={this.props.item.disable} >
            <div className="info">
                <span className="day">{props.item.day}</span>
                <span className="date">{props.item.date}</span>
            </div>
        </button>
    )
